import React from "react";
import extracy from "./extracy_logo.png";
import { Grid } from "semantic-ui-react";

const RightPanel = () => {
  return (
    <div>
      <Grid>
        <Grid.Row columns={1} centered>
          <img
            src={extracy}
            alt=""
            // style={{
            //   position: "relative",
            //   top: "20vh",
            //   left: "6vw",
            //   width: "55vw",
            // }}
          ></img>
        </Grid.Row>
        <Grid.Row>
          <Grid columns={4} divided>
            <Grid.Row>
              <Grid.Column style={{ width: "35vw" }}>Wubba</Grid.Column>
              <Grid.Column>Lubba</Grid.Column>
            </Grid.Row>
          </Grid>
        </Grid.Row>
      </Grid>
    </div>
  );
};

export default RightPanel;
